END_RESULT “Company Material Adverse Effect” means any change, event, effect or circumstance which, individually or in the aggregate, has resulted in or would reasonably be expected to result in a material adverse effect on the business, financial condition or results of operations of the Company and its Subsidiaries, taken as a whole. The following changes, events, effects, or circumstances shall be excluded from the determination of Company Material Adverse Effect:

(i) Any condition, change, effect, or circumstance generally affecting any of the industries or markets in which the Company or its Subsidiaries operate;
(ii) Any change in any law or GAAP (or changes in interpretations of any law or GAAP);
(iii) General economic, regulatory, or political conditions (or changes therein) or conditions (or changes therein) in the financial, credit, or securities markets (including changes in interest or currency exchange rates) in the United States or any other country or region in the world;
(iv) Any acts of God, force majeure events, natural disasters, terrorism, cyberattack, data breach, armed hostilities, sabotage, war, or any escalation or worsening of any of the foregoing;
(v) Any epidemics, pandemics, or contagious disease outbreaks (including COVID-19) and any political or social conditions, including civil unrest, protests, and public demonstrations or any other COVID-19 Measures that relate to, or arise out of, an epidemic, pandemic, or disease outbreak (including COVID-19) or any change in such COVID-19 Measures, directive, pronouncement, or guideline or interpretation thereof, or any continuation or of any of the foregoing, in the United States or any other country or region in the world;
(vi) The negotiation, execution, announcement, performance, consummation, or existence of this Agreement or the transactions contemplated by this Agreement, including (A) by reason of the identity of Elon Musk, Parent, or any of their Affiliates or their respective financing sources, or any communication by Parent or any of its Affiliates or their respective financing sources, including regarding their plans or intentions with respect to the conduct of the business of the Company or any of its Subsidiaries and (B) any litigation, claim or legal proceeding threatened or initiated against Parent, Acquisition Sub, the Company, or any of their respective Affiliates, officers, or directors, in each case, arising out of or relating to this Agreement or the transactions contemplated by this Agreement, and including the impact of any of the foregoing on any relationships with customers, suppliers, vendors, collaboration partners, employees, unions, or regulators;
(vii) Any action taken pursuant to the terms of this Agreement or with the consent or at the direction of Parent or Acquisition Sub (or any action not taken as a result of the failure of Parent to consent to any action requiring Parent’s consent pursuant to Section 6.1);
(viii) Any changes in the market price or trading volume of the Company Common Stock, any failure by the Company or its Subsidiaries to meet internal, analysts’ or other earnings estimates or financial projections or forecasts for any period, any changes in credit ratings and any changes in any analysts’ recommendations or ratings with respect to the Company or any of its Subsidiaries (provided that the facts or occurrences giving rise to or contributing to such changes or failure that are not otherwise excluded from the definition of “Company Material Adverse Effect” may be taken into account in determining whether there has been a Company Material Adverse Effect); and
(ix) Any matter disclosed in the Company SEC Documents filed by the Company prior to the date of this Agreement (other than any disclosures set forth under the headings “Risk Factors” or “Forward-Looking Statements”).
